import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import "materialize-css/dist/css/materialize.min.css";
// ========================================
import M from "materialize-css";
import LoginNav from "./components/navs/LoginNav";
import WelcomeNav from "./components/navs/WelcomeNav";

class LoginForm extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }
  render() {
    return (
      <>
        <main className="valign-wrapper">
          <div className="row">
            <div className="col s12 m10 offset-m1 card center">
              <h5>Login</h5>
              <div className="input-field col s12">
                <input
                  className="validate"
                  type="text"
                  name="username"
                  id="email"
                  required
                />
                <label for="email">Username</label>
              </div>

              <div className="input-field col s12">
                <input
                  className="validate"
                  type="password"
                  name="password"
                  id="password"
                  required
                />
                <label for="password">Password</label>
              </div>
              <button className="btn btn-small green waves-effect">
                Login
              </button>
            </div>
          </div>
        </main>
      </>
    );
  }
}
class Footer extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }
  render() {
    return (
      <footer className="page-footer black">
        <div className="container">
          <div className="row">
            <div className="col l6 s12">
              <h5 className="white-text">The SCARS Project</h5>
              <p className="grey-text text-lighten-4">
                Web tools for your graphing needs.
              </p>
            </div>
          </div>
        </div>
        <div className="footer-copyright">
          <div className="container">
            Â© 2014 Copyright Text
            <a className="grey-text text-lighten-4 right" href="#!">
              More Links
            </a>
          </div>
        </div>
      </footer>
    );
  }
}

class UploadForm extends React.Component {
  componentDidMount() {
    M.AutoInit();
  }
  render() {
    return (
      <>
        <main className="valign-wrapper">
          <div className="row">
            <div className="col s12 m12 card center">
              <label>Materialize File Input</label>
              <div className="file-field input-field">
                <div className="btn">
                  <span>Browse</span>
                  <input type="file" />
                </div>

                <div className="file-path-wrapper">
                  <input
                    className="file-path validate"
                    type="text"
                    placeholder="Upload file"
                  />
                </div>
              </div>
            </div>
          </div>
        </main>
      </>
    );
  }
}

ReactDOM.render(
  <>
    <LoginNav />
    <LoginForm />
    <Footer />
  </>,
  document.getElementById("root")
);
